import React from "react";
import { ComponentMeta, Story } from "@storybook/react";
import CandleStickChart, { ChartProps } from "./";
import { colors } from "../../theme/colors";

// More on default export: https://storybook.js.org/docs/react/writing-stories/introduction#default-export
export default {
  title: "Charts/CandleStick",
  component: CandleStickChart,
  // More on argTypes: https://storybook.js.org/docs/react/api/argtypes
  argTypes: {},
} as ComponentMeta<typeof CandleStickChart>;

// More on component templates: https://storybook.js.org/docs/react/writing-stories/introduction#using-args
const Template: Story<ChartProps> = (args) => <CandleStick {...args} />;

export const CandleStick = Template.bind({});

CandleStick.args = {};



CandleStick.parameters = { storySource: { source: "(args) => <CandleStick {...args} />" }, ...CandleStick.parameters };
